(423, 'options_description', '«Кабінет інноваційної сучасної стоматології» — професійна стоматологічна клініка міста Івано-Франківська, яка працює у сфері профілактики і лікування захворювань порожнини рота.  Ми надаємо послуги європейського рівня якості за розумними цінами. У цьому медичному закладі на вас чекають висококваліфіковані спеціалісти та сучасне обладнання.  «КІСС» — це широкий спектр послуг та бездоганне виконання кожної стоматологічної процедури.', 'no'),
