(5, 1, '2020-06-11 19:42:30', '2020-06-11 16:42:30', '<h3 class=\"title mb-3\">Запишіться</h3>\r\n<div class=\"form-group\">\r\n   [text* text-168 class:form-control placeholder \"Ім\'я\"]\r\n</div>\r\n<div class=\"form-group\">\r\n   [tel* tel-745 class:form-control placeholder \"Телефон\"]\r\n</div>\r\n[submit class:btn class:btn_apt class:wow class:animate__animated class:animate__headShake \"Передзвоніть мені\"]\n1\nkiss \"[your-subject]\"\n\nkiss@kiss.com\nВід: [your-name] <[your-email]>\r\nТема: [your-subject]\r\n\r\nТекст повідомлення:\r\n[your-message]\r\n\r\n-- \r\nЦе повідомлення було відправлено з сайту kiss (http://kiss:8888)\n\n\n\n\n\nkiss \"[your-subject]\"\nkiss <wordpress@kiss>\n[your-email]\nТекст повідомлення:\r\n[your-message]\r\n\r\n-- \r\nЦе повідомлення було відправлено з сайту kiss (http://kiss:8888)\nReply-To: kiss@kiss.com\n\n\n\nПовідомлення надіслане.\nПовідомлення не відправлене\nОдне або декілька полів містять помилкові дані. Будь ласка, перевірте їх і спробуйте ще раз.\nПовідомлення не відправлене\nВи повинні прийняти умови та положення перед тим, як відправляти Ваше повідомлення.\nПоле обов\'язкове для заповнення.\nПоле занадто довге.\nПоле занадто коротке.\nФормат дати некоректний.\nВведена дата надто далеко в минулому.\nВведена дата надто далеко в майбутньому.\nПід час завантаження файлу сталася невідома помилка.\nВам не дозволено завантажувати файли цього типу.\nФайл занадто великий.\nПід час завантаження файлу сталася помилка.\nФормат числа некоректний.\nЧисло менше мінімально допустимого.\nЧисло більше максимально допустимого.\nНеправильна відповідь на питання перевірки.\nНекоректна електронна адреса.\nНекоректне URL посилання.\nНекоректний номер телефону.', 'Контактна форма 1', '', 'publish', 'closed', 'closed', '', '%d0%ba%d0%be%d0%bd%d1%82%d0%b0%d0%ba%d1%82%d0%bd%d0%b0-%d1%84%d0%be%d1%80%d0%bc%d0%b0-1', '', '', '2020-06-30 22:18:53', '2020-06-30 19:18:53', '', 0, 'http://kiss:8888/?post_type=wpcf7_contact_form&#038;p=5', 0, 'wpcf7_contact_form', '', 0),
